function Name(){
  return (
    <>

      <Col className="gutter-row" span={6}>
        <div style={style}>col-6</div>
      </Col>
      <Col className="gutter-row" span={6}>
        <div style={style}>col-6</div>
      </Col>
      <Col className="gutter-row" span={6}>
        <div style={style}>col-6</div>
      </Col>
      <Col className="gutter-row" span={6}>
        <div style={style}>col-6</div>
      </Col>

      <div className="name-container">
        {
          Data.map((item)=>
            <Row gutter={16}>
              <div>{item.name}</div>
                <ul>
                  {Object.values(item.Slots).map((sub)=>
                    {return(sub ?
                        <Survey company={sub}/>
                        : <></>
                    )}
                  )}
                </ul>
            </Row>
          )
        }
      </div>
    </>
  );
}
export default Name;
